// import Header from '../components/Header';
import Layout from '../components/MyLayout';
import Head from 'next/head';
import { Component } from 'react';

export default class AdminProfile extends Component {
	render() {
		return (
			<Layout title="Admin Profile">
				<Head>
					<title>Admin Profile</title>
					<link
						rel="stylesheet"
						href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
						integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
						crossorigin="anonymous"
					/>
				</Head>

				<div className="card-space">
					<img
						className="imageHead"
						src="https://images.unsplash.com/photo-1474540412665-1cdae210ae6b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60"
						alt=""
					/>
					<div className="container leftAlign">
						<h1>Admin Dashboard</h1>
						<h3>What would you like to do?</h3>
						<hr />
					</div>
				</div>

				<div className="container">
					<div ClassName="row">
						<div className="col-sm special">
							<div className="box">Add comments to users</div>
							<div className="box">Check Bookings</div>

							<button className="btn btn-info" onClick={this.toPrivateClass}>
								Start
							</button>
						</div>
					</div>
				</div>

				<style jsx>
					{`
						.imageHead {
							// background-size: contain;
							width: 100%;
							height: 300px;
							object-fit: cover;
							object-position: 0 80%;
						}
						.card-space {
							padding-top: 3%;
						}
						.leftAlign {
							text-align: left;
							padding-top: 1%;
							margin-bottom: 1%;
						}
						.box {
							border: 1px solid black;
							padding: 2px;
							margin: 2px;
						}
						.special {
							// border: 1px solid blue;
							padding: 30px;
							margin: 10px;
							box-shadow: 9px 7px 25px -10px rgba(0, 0, 0, 0.75);
						}
					`}
				</style>
			</Layout>
		);
	}
}
